import React from 'react';
import {FooterContacts, FooterNav, FooterNavList, FooterNavListItem, FooterTitle, StyledFooter} from "./style";

function Footer() {
  return (
    <StyledFooter>
      <FooterContacts>
        <FooterTitle>Contact Us</FooterTitle>
        <FooterNav>
          <FooterNavList>
            <FooterNavListItem></FooterNavListItem>
          </FooterNavList>
        </FooterNav>
      </FooterContacts>
    </StyledFooter>
  );
}

export default Footer;
